import Link from 'next/link';
import Layout from '../components/Layout';

const News = ({news}) => (
    <Layout>
        <h2> List of News</h2>
        <hr/>
        {JSON.stringify(news)}
    </Layout>
);

News.getInitialProps = async () => {
    let news;
    try {
        const res = await fetch('https:/hn.algolia.com/api/v1/search?query=react');
        news = await res.json();
        console.log(news);
    } catch (error) {
        console.log(`There was an error ${error}`)
        news = [];
    }
    return {
        news
    };
};

export default News;
